Firstly, you're going to need to import the sprites into your project. agb has great support for the aseprite sprite editor which can be bought for $20 or you can compile it yourself for free. Aseprite files can be natively imported by agb for use on the Game Boy Advance. Here is the sprite sheet we will use as a png, but you should download the aseprite file and place it in gfx/sprites.aseprite. pong sprites This contains 5 16x16px sprites. The first is the end cap for the paddle. The second is the centre part of the paddle, which could potentially be repeated a few times. The third until the fifth is the ball, with various squashed states. The aseprite file defines tags for these sprites, being "Paddle End", "Paddle Mid", and "Ball". use agb::{ include_aseprite, display::object::{Graphics, Tag}
}; // Import the sprites in to this constant. This holds the sprite // and palette data in a way that is manageable by agb.
const GRAPHICS: &Graphics = include_aseprite!("gfx/sprites.aseprite"); // We define some easy ways of referencing the sprites
const PADDLE_END: &Tag = GRAPHICS.tags().get("Paddle End");
const PADDLE_MID: &Tag = GRAPHICS.tags().get("Paddle Mid");
const BALL: &Tag = GRAPHICS.tags().get("Ball"); This uses the include_aseprite macro to include the sprites in the given aseprite file. Now, let's put this on screen by firstly creating the object manager and then creating an object, this will also involve the creation of the main entry function using the entry macro. The signature of this function takes the Gba struct and has the never return type, this means Rust will enforce that this function never returns, for now we will achieve this using a busy loop. Using the Gba struct we get the ObjectController struct which manages loading and unloading sprites and objects. #[agb::entry]
fn main(gba: mut agb::Gba) -> ! { // Get the object manager let object = gba.display.object.get(); // Create an object with the ball sprite let mut ball = object.object_sprite(BALL.sprite(0)); // Place this at some point on the screen, (50, 50) for example ball.set_x(50).set_y(50).show(); // Now commit the object controller so this change is reflected on the screen. // This isn't how we will do this in the final version of the code, but will do // for this example. object.commit(); loop {}
} If you run this you should now see the ball for this pong game somewhere in the top left of the screen.

