The GBA renders to the screen one pixel at a time a line at a time from left to right. After it has finished rendering to each pixel of the screen, it briefly pauses rendering before starting again. This period of no drawing is called vblank, which stands for the 'vertical blanking interval'. There is also a 'horizontal blanking interval', but that is outside of the scope of this book. You should .commit() your sprites only during this vblank phase, because otherwise you may end up moving a sprite during the rendering which could cause tearing of your objects [1] . agb provides a convenience function for waiting until the right moment called agb::display::busy_wait_for_vblank(). You shouldn't use this is a real game (we'll do it properly later on), but for now we can use this to wait for the correct time to commit our sprites to memory. Making the sprite move 1 pixel every frame (so 60 pixels per second) can be done as follows: // replace the call to object.commit() with the following: let mut ball_x = 50;
let mut ball_y = 50;
let mut x_velocity = 1;
let mut y_velocity = 1; loop { // This will calculate the new position and enforce the position // of the ball remains within the screen ball_x = (ball_x + x_velocity).clamp(0, agb::display::WIDTH - 16); ball_y = (ball_y + y_velocity).clamp(0, agb::display::HEIGHT - 16); // We check if the ball reaches the edge of the screen and reverse it's direction if ball_x == 0 || ball_x == agb::display::WIDTH - 16 { x_velocity = -x_velocity; } if ball_y == 0 || ball_y == agb::display::HEIGHT - 16 { y_velocity = -y_velocity; } // Set the position of the ball to match our new calculated position ball.set_x(ball_x as u16).set_y(ball_y as u16); // Wait for vblank, then commit the objects to the screen agb::display::busy_wait_for_vblank(); object.commit();
}

